-- ------------------------------------------------
-- Version: v1.31
--
-- Description: Migration that introduces the identifier property relation
-- -------------------------------------------------

CREATE TABLE k_Identifier_Property (
    ID_IDN_PRP integer,
    lodIDN character varying(255) NOT NULL,
    lodRelation character varying(255),
    lodPRP character varying(255),
    Value_ character varying(255) NOT NULL,
    lod_IDN_PRP_V character varying(255),
    populatedBy character varying(255),
    lastTouch character varying(255),
    PRIMARY KEY (lodIDN, lodRelation, lodPRP, Value_),
    FOREIGN KEY (lodIDN) REFERENCES k_Identifier(lodIDN) ON DELETE CASCADE,
    FOREIGN KEY (lodPRP) REFERENCES k_Property(lodPRP) ON DELETE CASCADE
);


